                </p>

                </div>
                <div className="col-md-4">
                <h6 class="mt-3">
                    Quick Links
                </h6>
                <hr/>

                

                <div><Link to="/" style={{ textDecoration: 'none', color:'white'}}>{hoverStyle({ Hovered })} ref={Hovertarget}>
      {Hovered ? "Hovered Style" : "Default Style"}</Link></div>
                <div><Link to="/about" style={{ textDecoration: 'none', color:'white' }}>About Us</Link></div>
                <div><Link to="/contact" style={{ textDecoration: 'none', color:'white' }}>Contact</Link></div>
                

                </div>

